/**
 * @param {number[]} nums
 * @param {number} limit
 * @return {number}
 */
var minMoves = function(nums, limit) {
  let cache = {};
  let len = nums.length;
  // 保证是偶数的长度；
  let dLen = len / 2;
  let arr2 = [];

  // 先求出.
  for (let i = 0; i < dLen; i++) {
    let v1 = nums[i];
    let v2 = nums[len - 1 - i];
    let key = `${nums[i] + nums[len - 1 - i]}v`

    if (!cache[key]) {
      cache[key] = 1;
    }
    cache[key] += 1;

    arr2.push({
      total: v1 + v2,
      min: Math.min(v1, v2) + 1,
      max: Math.max(v1, v2) + limit,
    });
  };

  let keys = Object.keys(cache);
  let kLen = keys.length;
  let maxLen = 0;

  keys.forEach((item) => {
    maxLen = Math.max(maxLen, cache[item]);
  });

  let maxStep = len;
  keys.forEach((item) => {
    maxLen = Math.max(maxLen, cache[item]);
  });

  for (let i = 0; i < kLen; i++) {
    let key = keys[i];
    let cacheLen = cache[key];
    let v = parseInt(key);

    if (maxLen / 2 > cacheLen) {
      // 不用做处理了，直接滚动到下一个；
      continue;
    }

    let _step = 0;
    // 先求出.
    for (let j = 0; j < dLen; j++) {
      let obj = arr2[j]
      
      if (obj.total == v) {
        _step += 0;
      } else if (v >= obj.min && v <= obj.max) {
        _step += 1;
      } else {
        _step += 2;
      }
    };

    maxStep = Math.min(maxStep, _step)
  }

  return maxStep;
};
